import React from 'react';

class NameBar extends React.Component {

  render() {
    return (
      <div>
          <form>
            <label for="fname">Enter your Name</label>
            <br/>
            <input type="text" id="fname" name="fname"/>
          </form>
      </div>
    );
  }
}

export default NameBar;
